query {
    getTeachersByFaculty(faculty: "FOF") {
        teacher
        pulpit {
            pulpit_name
            faculty {
                faculty
            }
        }
    }
}

query {
    getSubjectsByFaculty(faculty: "FOF") {
        subject
        pulpit {
            pulpit
            faculty {
                faculty
            }
        }
    }
}

query ($faculty: String) {
    getFaculties(faculty: $faculty) {
        faculty
        pulpits{
            pulpit_name
        }
    }
}

query {
    getPulpits {
        pulpit_name
        subjects {
            subject_name
        }
        teachers {
            teacher_name
        }
    }
}

query {
    getSubjects {
        subject_name
        pulpit {
            pulpit_name
            faculty {
                faculty_name
            }
        }
    }
}

query {
    getTeachers(teacher: "ASI") {
        teacher
        teacher_name
        pulpit { 
            pulpit
            pulpit_name
        }
    }
}

query {
    getPulpits(pulpit: "ISIT") {
        pulpit
        teachers {
            teacher_name
        }
        subjects {
            subject
            subject_name
        }
    }
}

query {
    getSubjects(subject: "DB") {
        subject
        subject_name
        pulpit {
            pulpit_name
        }
    }
}

