}

fragment postPulpit on Pulpit {
    pulpit
}

fragment postFaculty on Faculty {
    faculty
    faculty_name
}

mutation {
  setFaculty(faculty: {
      faculty: "FOF"
      faculty_name: "fadslkf"
  }) {
      ...postFaculty
      pulpits{
          ...postPulpit
      }
  }
}

